# Matriz usada para cadastrar a lista de produtos pré definidos
produtos = [
[306, 'TV LG 50', 3200.00],
[721, 'Geladeira Brastemp 800', 7800.00],
[485, 'Forno Eletrico GE 40', 850.00],
[961, 'Geladeira Consul 500', 2600.00],
[388, 'TV Philips 60', 4500.00]
]

# Função para listar os produtos registrados
def listar(produtos):
  for i in produtos:
    print(f'Código: {i[0]} - Descrição: {i[1]} - Preço: {i[2]}\n')

# Função para inserios novos produtos na Matriz
def inserir(produtos):
    codigo = int(input('Digite o código do produto: '))
    descricao = input('Digite a descrição do produto: ')
    preco = float(input('Digite o preço do produto: '))
    produtos.append([codigo, descricao, preco])

# Função para atualizar os produtos na Matriz
def atualizar(produtos):
    codigo = int(input('Digite o código do produto que deseja atualizar: '))
    for i in produtos:
        if i[0] == codigo:
            novo_preco = float(input('Digite o novo preço do produto: '))
            i[2] = novo_preco
        else:
            print("produto não encontrado.")
            break

# Função para excluir os produtos na Matriz
def excluir(produtos):
    codigo = int(input('Digite o código do produto que deseja excluir: '))
    for i in produtos:
        if i[0] == codigo:
            produtos.remove(i)

# Função para buscar as informações de determinado produto solicitado pelo usuário
def buscar_descricao(produtos):
    descricao = input('Digite a descrição do produto que deseja buscar: ').lower()
    for i in produtos:
        if descricao in i[1].lower():
            print(f'Código: {i[0]} - Descrição: {i[1]} - Preço: {i[2]}')

# Função para encontrar os preços dos produtos dentro do intervalo inserido pelo usuário
def buscar_preco(produtos):
  minimo = float(input('Digite o preço mínimo que deseja buscar: '))
  maximo = float(input('Digite o preço máximo que deseja buscar: '))

  for i in produtos:
    if i[2] >= minimo and i[2] <= maximo:
      print(f'Código: {i[0]} - Descrição: {i[1]} - Preço: {i[2]}')

# Função que inicializa o programa apresentando o MENU de opções para o usuário escolher.
def inicializar():
    while True:
        print('\noperações disponíveis:\n')
        print('1. listar catálogo.')
        print('2. inserir produto.')
        print('3. atualizar preço.')
        print('4. excluir pelo código.')
        print('5. buscar produto pela descrição.')
        print('6. buscar produto pelo preço.')
        print('0. sair.\n')


        escolha = int(input('escolha uma opção: \n'))

        if escolha == 0:
            break
        elif escolha == 1:
            listar(produtos)
        elif escolha == 2:
            inserir(produtos)
        elif escolha == 3:
            atualizar(produtos)
        elif escolha == 4:
            excluir(produtos)
        elif escolha == 5:
            buscar_descricao(produtos)
        elif escolha == 6:
            buscar_preco(produtos)
        else:
            print('Opção inválida. Tente novamente.')


inicializar()

